import React from 'react';
import { Link } from 'react-router-dom';

const Webpage = () => {
    return (
      <div style={{ fontFamily: 'Arial, sans-serif' }}>
        <header style={{ display: 'flex', justifyContent: 'flex-end', padding: '10px' }}>
          <button style={{ padding: '5px 15px', marginRight: '10px' }}>Login</button>
        </header>
        <main style={{ textAlign: 'center', padding: '50px' }}>
          <h1>CHANGE THE WAY YOU MONEY</h1>
          <p>Learn the way you money online</p>
          <p>for those who want to learn how to perform online banking. Sign up in minutes.</p>
          <button style={{ padding: '10px 20px', marginTop: '20px' }}>Sign Up</button>
        </main>
      </div>
    );
  };
  
  export default Webpage;
